Europe to the Max: Hidden Treasures

Travel Documentary hosted by Rudy Maxa, published by Questar in 2011 - English narration


Information
------------------------------

Europe to the Max: Hidden Treasures  
Experience the best of Beautiful Europe with Rudy Maxa, one of America's premier consumer travel experts. High Definition photography and authoritative commentary make this 6-DVD collection the essential travel accessory. Join Rudy, as he heads outside of London to Dublin and Edinburgh, explore the splendors of France in Normandy and the wine country. Take in the stunning beauty of the Greek Islands before heading to some of Europe's greatest cities including London and Paris. Finally, cruise down Germany s romantic road and trek into the rugged magnificence of the Alps. Includes: Treasures Outside London, Splendors of France, Mysteries of Greece and Rome, Great Cities of Europe, Romantic Germany and Beyond, Alpine Secrets.




13)  Europes Great Cities 2 
We can jet to Europe in a day and visit four cities in less than a week. It's great to take your time but sometimes you only have a day to visit. How can you be part of the international jet set and still get a taste of &quot;old&quot; Europe? This time Smart Travels takes viewers on a whirlwind tour of four cities that represent a bit of the old and bit of the new in Europe. Rudy shows viewer how to get the most out of one-day visits to Copenhagen, Berlin, Munich, and Rome. Tips on maximizing travel memories from a 24-hour stay in a European big city.



